import React, { Component } from 'react';

class CapabilitiesList extends Component{
   constructor(props) {
    super(props);

    this.state = {
        capabilities: [
            { title: "Business Development and Team Building", icon:"fas fa-briefcase", list:[]},
            { title: "Staffing", icon:"fas fa-users", list:[]},
            { title: "IT Services", icon:"fas fa-server", list:[]},
            { title: "Operations", icon:"fas fa-chalkboard-teacher", list:[]},
            { title: "Facilities Management", icon:"far fa-building", list:[]}            
        ]
    }
   }

   render(){
      return(
         <div className="capabilities-body">
        
         </div>
      );
   }
}

export default CapabilitiesList;
